import React, { useEffect } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import Preloader from "../layout/Preloader";
import ArchivedItem from "./ArchivedItem";
import { getLogs, archiveLog } from "../../store/actions/logActions";

const ArchivedRoutes = ({ log: { logs, loading }, arch: archive, getLogs }) => {
  useEffect(() => {
    getLogs();
    // eslint-disable-next-line
  }, []);

  if (loading || logs === null) {
    return <Preloader />;
  }

  return (
    <div>
      <div className="row">
        <div className="col s12">
          <ul className="collection with-header">
            <li className="collection-header">
              <h4 className="center">Archived Routes</h4>
            </li>
            {!loading && logs.length === 0 ? (
              <p className="center">No logs to show...</p>
            ) : (
              logs.map(log => <ArchivedItem log={log} key={log.id} />)
            )}
          </ul>
        </div>
      </div>
    </div>
  );
};

ArchivedRoutes.propTypes = {
  log: PropTypes.object.isRequired,
  getLogs: PropTypes.func.isRequired
};

const mapStateToProps = state => ({
  log: state.log,
  arch: state.archive
});

export default connect(mapStateToProps, { getLogs })(ArchivedRoutes);
